// Helper function to get vector by slug
export function getCareerVector(slug: string): CareerVector | undefined {
  return CAREER_VECTORS.find(v => v.slug === slug);
}

// Helper function to get vectors by category
export function getVectorsByCategory(category: string): CareerVector[] {
  return CAREER_VECTORS.filter(v => v.category === category);
}
